import "./App.css";
import Container from "./Container/Container";
import {Switch, Route} from "react-router-dom";

function App() {
  return (
    <div>
      <Switch>
        <Route path="/" component={Container}/>
      </Switch>  
    </div>
  );
}

export default App;
